import React from 'react';
import { AppBar, Toolbar, Typography } from "@material-ui/core";

const Header = () => {

    const logo  = (
        <Typography variant="h6" component="h1">
            SNP-LAMP DESIGNER
        </Typography> 
    );

    return (
        <header>
            <AppBar className='header'>
                <Toolbar>{logo}</Toolbar>
            </AppBar>
        </header>
    );
};

export default Header;
